import React, { useEffect } from 'react';
import { useDispatch, useSelector } from 'react-redux';
import { listProducts } from '../actions/productActions';

function SearchScreen() {
  const dispatch = useDispatch();

  const productList = useSelector((state) => state.productsList); // Ensure productsList is correctly named as in the store
  const { loading, error, products } = productList || {}; // Provide default empty object if productList is undefined

  useEffect(() => {
    dispatch(listProducts()); // Fetch the list of products when the component loads
  }, [dispatch]);

  return (
    <div>
      {loading ? (
        <h2>Loading...</h2>
      ) : error ? (
        <h2>{error}</h2>
      ) : (
        <div>
          {products.map((product) => (
            <div key={product._id}>{product.name}</div>
          ))}
        </div>
      )}
    </div>
  );
}

export default SearchScreen;
